  18,\n\t\"tags\": [],\n\t\"title\": \"Dissolved inorganic carbon, pH, alkalinity,
  temperature, salinity and other variables collected from discrete sample and profile
  observations using CTD, bottle and other instruments from the ODEN in the Arctic
  Ocean, Barents Sea and others from 2002-04-20 to 2002-06-06 (NODC Accession 0113590)\",\n\t\"tracking_summary\":
