  [],\n\t\"revision_timestamp\": \"2015-09-27T02:54:10.702985\",\n\t\"name\": \"dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-frodeb91\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113590 includes chemical,
  discrete sample, physical and profile data collected from ODEN in the Arctic Ocean,
  Barents Sea, North Atlantic Ocean and North Greenland Sea from 2002-04-20 to 2002-06-06
  and retrieved during cruise CARINA/77DN20020420. These data include ALKALINITY,
  CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
  (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta),
  SALINITY, SILICATE, SULFUR HEXAFLUORIDE (SF6), WATER TEMPERATURE and pH. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  Leif Anderson of Gothenburg University; Department of Analytical and Marine Chemistry
  as part of the CARINA/77DN20020420 data set.nnThe CARINA (CARbon dioxide IN the
  Atlantic Ocean) data synthesis project is an international collaborative effort
  of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
  consistent data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"license_title\":
